class State:
    def __init__(self, x, y):
        self.x = x;
        self.y = y;
        
class Solution:
    
    # @param board, a 2D array
    # Capture all regions by modifying the input board in-place.
    # Do not return any value.
    def solve(self, board):
        if board == None or len(board) == 0:
            return board;
        row = len(board);
        col = len(board[0]);
        visited = [[False for i in range(col)] for i in range(row)];
        #print (len(visited));
        #print (len(visited[0]));
        for c in range(col):
            if visited[0][c] == False and board[0][c] == 'O':
                #self.dfs(board, visited, 0, c);
                self.dfsIterative(board, visited, 0, c);
            if visited[row - 1][c] == False and board[row - 1][c] == 'O':    
                #self.dfs(board, visited, row - 1, c);
                self.dfsIterative(board, visited, row - 1, c);
                        
        for r in range(row):
            if visited[r][0] == False and board[r][0] == 'O':
                #self.dfs(board, visited, r, 0);
                self.dfsIterative(board, visited, r, 0);
            if visited[r][col - 1] == False and board[r][col - 1] == 'O':
                #self.dfs(board, visited, r, col - 1);
                self.dfsIterative(board, visited, r, col - 1);
        for r in range(row):
            ss = '';
            for c in range(col):
                if (not visited[r][c]):
                    ss = ss + 'X';
                else :
                    ss = ss + 'O';
            board[r] = ss;    
        return board;
    
    def dfsIterative(self, board, visited, x, y):
        stack = [];
        visited[x][y] = True;
        stack.append(State(x, y));
        while len(stack) > 0:
            state = stack.pop();
            x1 = state.x;
            y1 = state.y;
            
            if x1 - 1 >= 0 and not visited[x1 - 1][y1] and board[x1 - 1][y1] == 'O':
                stack.append(State(x1 - 1, y1));
                visited[x1 - 1][y1] = True;
            if x1 + 1 < len(board) and not visited[x1 + 1][y1] and board[x1 + 1][y1] == 'O':
                stack.append(State(x1 + 1, y1));
                visited[x1 + 1][y1] = True;
            if y1 - 1 >= 0 and not visited[x1][y1 - 1] and board[x1][y1 - 1] == 'O':
                stack.append(State(x1, y1 - 1));
                visited[x1][y1 - 1] = True;
            if y1 + 1 < len(board[0]) and not visited[x1][y1 + 1] and board[x1][y1 + 1] == 'O':
                stack.append(State(x1, y1 + 1));
                visited[x1][y1 + 1] = True;
                
    def dfs(self, board, visited, x, y):
        if x < 0 or x >= len(board) or y < 0 or y >= len(board[0]):
            return;
        if visited[x][y] or board[x][y] != 'O':
            return;
        visited[x][y] = True;
        self.dfs(board, visited, x, y - 1);
        self.dfs(board, visited, x, y + 1);
        self.dfs(board, visited, x - 1, y);
        self.dfs(board, visited, x + 1, y);        
        
